description.narrative:
The proposed project combines the objectives of promotion of agriculture growth and sustainable & equitable water use. It concentrates on enhancing horticulture curricula and programs of two TVETs and one Higher Education providers. The focus of the project is to strengthen the technical capacities of their teaching staff and management to successfully provide these courses and educate young people in the field of horticulture sector development and optimizing water efficiency and wastewater re-use for irrigation. Curricula and courses will be strongly based on the needs in the horticulture labour market.

The project consortium and TVETs will focus collaboration on five key themes of horticulture sector development and optimizing water efficiency and wastewater re-use for irrigation:

1) technologies for water efficiency and waste water re-use for agriculture (skills, technology transfer, professional PP network); 

2) innovation, entrepreneurship & employability; 

3) full horticulture value chain development and skills needs; 

4) occupational & certification standards and matching industry-skills needs, incl. dual system & apprenticeship approach; 

5) gender, youth & marginalized groups incl. refugees. This approach will be institutionalized in and supported by a Dutch-Jordan Triple helix platform, with multiple stakeholders from the education, private, and public sectors. 

The approach will closely link with the OKP-JOR-104167, Water in Support of Agriculture, which is expected to start in the same period. 

The proposed project must contribute to the following long-term impact:

Promote agricultural growth: Create ecologically sustainable food systems

